import React from "react";

const SearchBox = ({ searchTerm, handleChange }) => {
  return (
    <div className="form-group">
      <input
        type="text"
        name=""
        placeholder="Search product"
        className="form-control"
        id="searchBar"
        value={searchTerm}
        onChange={handleChange}
      />
    </div>
  );
};

export default SearchBox;
